import '.././style/App.css';
import Sample from '.././feed/sample.json';

class Movies extends React.Component<props> {

  constructor(){
    super(props);
    this.state = {
        loading: true,
        movie: [],
      };
  }



    componentDidMount() {
      this.setState({
        loading: false,
        movie: Sample.entries
         });

      }

  render(){

    if (this.state.loading) {
      return <p>loading...</p>;
    }

    return (
      <div>

        <div>{this.state.movie.title}</div>
      </div>
    );
  }
}

export default Movies;
